import React from 'react'
import Component from './Contact_details'
import { Main, MainGrid, Subgrid } from './Contacts'
import {motion} from 'framer-motion';
function Counteranimation() {
    return (
        <Main>
            <MainGrid>
                <Component state='USA'customer='Clients' description=''></Component>
                <Component state='INDIA'customer='Clients' description=''></Component>
                <Component state='HAPPY' customer='Clients' description=''></Component>
            </MainGrid>
        </Main>
      
    )
}

export default Counteranimation
